import React, { Component } from 'react';
import SiteHeader from './components/SiteHeader';
import HomepageImage from './components/HomepageImage';
import { Link, animateScroll as scroll, Element, Events, scrollSpy, scroller } from 'react-scroll';
import Home from './components/Home';
import About from './components/About';
import Projects from './components/Projects';
import Contact from './components/Contact';
import More from './components/More';


class App extends Component {

  render() {
    return (

      <div>

        <div>
          <h1>Charlie Leopard</h1>
          <nav>
            <ul className='header'>
              <li><Link exact to="/" spy={true} smooth={true} duration={500} activeClass='active'>Home</Link></li>
              <li><Link to="/about" spy={true} smooth={true} duration={500} activeClass='active'>About me</Link></li>
              <li><Link exact to="/projects" spy={true} smooth={true} duration={500} activeClass='active'>Projects</Link></li>
              <li><Link to="/contact" spy={true} smooth={true} duration={500} activeClass='active'>Contact</Link></li>
              <li><Link exact to="/more" spy={true} smooth={true} duration={500} activeClass='active'>More</Link></li>
            </ul></nav>
        </div>

          <Element id='/' >
            <Home />
          </Element>

          <Element id='/about' >
            <About />
          </Element>

          <Element id='/projects' >
            <Projects />
          </Element>

          <Element id='/contact' >
            <Contact />
          </Element>

          <Element id='/more' >
            <More />
          </Element>

      </div>
    );
  }
}

export default App;
